import React from "react";

type PropsType = {
  items: Array<{ title: string; href?: string }>;
};

const List = ({ contacts }: PropsType) => {
  return (
    <ul>
      {contacts.map(contact => (
        <li>
          {contact.href ? (
            <a href={contact.href} target="_blank">
              {contact.title}
            </a>
          ) : (
            <span>{contact.title}</span>
          )}
        </li>
      ))}
    </ul>
  );
};

export default List;
